import React, { Component } from "react";
import { Row, Col, Button, Input} from "reactstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faArrowLeft, faChartBar, faHome } from "@fortawesome/free-solid-svg-icons";
import Header from "./header";
import { Table } from "reactstrap"
import {Redirect} from 'react-router-dom'
import { Line } from "react-chartjs-2";




class DivvyTripsChart extends Component {
    constructor(props) {
        super(props);
        this.state = {
            moveToHome: false,
            movetoStations: false,
            stations: [],
            data1: {
                labels: [],
                datasets: [
                  {
                    label: 'Monday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data2: {
                labels: [],
                datasets: [
                  {
                    label: 'Tuesday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data3: {
                labels: [],
                datasets: [
                  {
                    label: 'Wednesday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data4: {
                labels: [],
                datasets: [
                  {
                    label: 'Thursday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data5: {
                labels: [],
                datasets: [
                  {
                    label: 'Friday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data6: {
                labels: [],
                datasets: [
                  {
                    label: 'Saturday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            },
            data7: {
                labels: [],
                datasets: [
                  {
                    label: 'Sunday',
                    data: [],
                    backgroundColor: 'rgb(60, 179, 113)',
                  }
                ],
            }
        }
    }

    moveToHomePage() {
        this.setState({
            moveToHome: true
        })
    }

    moveToListOfStations() {
        this.setState({
            movetoStations: true
        })
    }

    handleChange(e) {
        this.setState({
            [e.target.name]: e.target.value
        })
    }

    render() {
        return (
            <div>
                {this.state.moveToHome? <Redirect to = "/find" />: null}
                {this.state.movetoStations? <Redirect to = {{
                    pathname: "/list_of_stations",
                    state: { stations: [], places: [], find: '', where: ''}
                }} 
                /> :null }
                <Header />
                <div style = {{textAlign: "left"}}>
                    <Row>
                        <Col md = {10}></Col>
                        <Col md = {2} style = {{padding: "20px"}}>
                            <Button style = {{backgroundColor: "#191970"}} onClick = {this.moveToListOfStations.bind(this)}>Go Back <span style = {{marginLeft: "10px"}}><FontAwesomeIcon icon = {faArrowLeft} /></span></Button>
                        </Col>
                    </Row>

                    {/* <Row>
                        <Col md = {2} style = {{padding: "20px"}}>
                            <Input type = "select" style = {{border: "none", borderBottom: "1px solid black"}} name="find" onChange = {this.handleChange.bind(this)}  placeholder = "Find">
                                <option value = "PAST HOUR">Past Hour</option>
                                <option value = "LAST 24 HOURS">Last 24 Hours</option>
                                <option value = "LAST 7 DAYS">Last 7 Days</option>
                            </Input>
                        </Col>
                    </Row> */}

                     <div>
                     <div style = {{padding: "20px"}}>
                    <Row>
                        <Col md = {6} xs = {6}>
                        <div>
                        <Bar
                            data = {this.state.data}
                            height={300}
                            options={{
                                maintainAspectRatio: false,
                                scales: {
                                yAxes: [
                                    {
                                        scaleLabel: {
                                            display: true,
                                            labelString: 'Divvy Trips'
                                        },
                                        ticks: {
                                            beginAtZero: true,
                                        },
                                    },

                                ],
                                xAxes: [
                                    {
                                        scaleLabel: {
                                            display: true,
                                            labelString: 'Time'
                                        },
                                        barPercentage: 0.1
                                    }
                                ]
                                },
                                legend: {
                                labels: {
                                    fontSize: 15,
                                },
                                },
                            }}
                            />
                        </div>
                        </Col>
                        <Col md = {6} xs = {6}>
                        <div>
                        <Bar
                            data = {this.state.data1}
                            height={300}
                            options={{
                                maintainAspectRatio: false,
                                scales: {
                                yAxes: [
                                    {
                                        scaleLabel: {
                                            display: true,
                                            labelString: 'Divvy Trips'
                                        },
                                        ticks: {
                                            beginAtZero: true,
                                        },
                                    },

                                ],
                                xAxes: [
                                    {
                                        scaleLabel: {
                                            display: true,
                                            labelString: 'Time'
                                        },
                                        barPercentage: 0.1
                                    }
                                ]
                                },
                                legend: {
                                labels: {
                                    fontSize: 15,
                                },
                                },
                            }}
                            />
                        </div>
                        </Col>
                    </Row>

                    </div>
                    </div>
                </div >
            </div>

        );
    }
}

export default (DivvyTripsChart);
